import "./productCard.css"

export default function productCard({size}){
    if(size === 1){
        return(
            <div>
            <div className="smallCard">
                <img src="./InitialProductCards/BlackT.jpg" />
                <div>₹1,999</div>
            </div>
            </div>
        )
    }
    else{
        return(
            <div className="largeCard">
                <img src="./InitialProductCards/BlueT.jpg" />
                <div>₹999</div>
            </div>
        )
    }
}
